import logo from './logo.svg';
import './App.css';
import React from 'react'
import {useState} from 'react'
/* import Box from '@mui/material/Box'; */
/* import Button from '@mui/material/Button'; */
/*import TextField from '@material-ui/core/TextField';*/
/*import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';*/
/*<TextField id="standardtextfield" label="Enter qty" variant="standard" />*/
/*
<form noValidate autoComplete = "off">
        <TextField
        label = "Enter qty"
        />
      </form>
*/
/* Reused Selection component multiple times within the Projects component to further modularize the project*/
/* Passed props from parent to child twice (App passed props to Projects and Projects passed props to Selection)*/

function Selection(props){
  return(
    <header> 
      <form>
        <label> 
          {props.title}: <input type = "text"/>
        </label>
      </form>
    </header>
  )
}

function Button(props){
  function handleClick() {
    alert("Thanks for clicking me!");
  };
  return(
    <header> 
      <button onClick = {handleClick}>
        {props.btnName}
      </button>
    </header>
  );  
}

function Projects(props) {
  return (
    <header> 
      <h1>Hello {props.name}! This is the project catalog:</h1>
      <h3 className = 'customheader'>Project {props.number/3} <Button  btnName = "Join"/></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>HW Set {props.number/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>HW Set {props.number*2/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h3>Project {props.number*2/3} <button className = 'status'>Status</button></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>HW Set {props.number*3/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>HW Set {props.number*4/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h3>Project {props.number*3/3} <button className = 'status'>Status</button></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>HW Set {props.number*5/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>HW Set {props.number*6/3}: {props.initsize}/{props.initsize}
      <Selection title = {props.title}/>
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
    </header>
  )
}

class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Projects name = 'User' title = 'Enter Qty' number = {3} initsize = {100}/>
        </header>
      </div>
    );
  }
}

export default App;
